window.bookSummaryJSON = "<p>Their authoritative presence is felt before anything else. My heart skips a beat and my blood runs cold. They’re here.</p> <p>The voluminous cloaks cover their bodies entirely, and their faces are mostly concealed by their hoods. Standing with their broad shoulders squared and hands tucked behind their backs, they emanate sheer masculinity and dominance.</p> <p>His baritone voice whispers, and his breath burns hot against the shell of my ear. His tone is gentle, but there’s no doubt in my mind that his words are a command.</p> <p>Gather and present yourself. This is the offering....</p> <p><i>To Be Claimed</i> is a dark paranormal romance collection with high heat and suspense to keep you on edge. It features the novels <i>Wounded Kiss</i>, <i>Gentle Scars</i>, and <i>Primal Lust</i>.</p>"; 
